import React from 'react';
import './notFound.scss';
import img from './png/img.png'

const NotFound = () => {
    return (
        <div className="face">
            <div className="band">
                <div className="red">
				</div>
                <div className="white">
				</div>
                <div className="blue">
				</div>
            </div>
            <div className="eyes">
			</div>
            <div className="dimples">
			</div>
            <div className="mouth">
			</div>
        </div>
	);
};

export default NotFound;
